@Rouca it doesn't ..torrent if you know is based on users so even if the leachers are way more ..you as a downloader with incomplete torrent can also download from a leacher the parts that he has but you haven't!

So more users ..better speed, especially if the seeders are over 1000 (they spread small bits to everyone and everyone is exchanging the bits at higher speed)

